import React, {Component} from 'react';
import Topsell from "./Topsell";

class Topsells extends Component {
    render() {
        return (
            <div>
            <div className="topsell" data-aos="fade-left">
                <Topsell anhweb="img/web7.png" tentrang="Education" motaweb="Web tổ chức giáo dục" giaweb="1290k" nen="nenv"/>
                <Topsell anhweb="img/web6.png" tentrang="Hospital" motaweb="Website tổ chức y tế" giaweb="790k" nen="nenx"/>
                <Topsell anhweb="img/web1.png" tentrang="Education" motaweb="Công ty,doanh nghiệp..." giaweb="1790k" nen="nenh"/>
            </div>
            <div className="topsell" data-aos="fade-right">
                <Topsell anhweb="img/web7.png" tentrang="Education" motaweb="Web tổ chức giáo dục" giaweb="1290k" nen="nenv"/>
                <Topsell anhweb="img/web6.png" tentrang="Hospital" motaweb="Website tổ chức y tế" giaweb="790k" nen="nenx"/>
                <Topsell anhweb="img/web1.png" tentrang="Education" motaweb="Công ty,doanh nghiệp..." giaweb="1790k" nen="nenh"/>
            </div>
            </div>
        );
    }
}

export default Topsells;
